import React from 'react';
import {Nav, NavbarContainer,NavLogo} from './NavbarElements';


const Navbar = () => {
    return (
        <>
        <Nav>
            <NavbarContainer>
                <NavLogo to='/'>
                    Finder
                </NavLogo>
            </NavbarContainer>
        </Nav>

        </>
    );
};

export default Navbar;
